import React from 'react';
import { Link } from "react-router-dom";

const start_page = () => {
    return (
        <div>
            <h1>Start</h1>
            <p>This is start_page</p>
            <div>
                <Link to="/problem" className="btn btn-primary">Задачи</Link>
            </div>
        </div>
    );
}

export default start_page;
